import React, {Component} from "react";
import { Rating, Card, Image } from "semantic-ui-react";
import telefonica from '../Home/telefonica.png';
import { makeStyles } from '@material-ui/core/styles'
import {Grid, Button, Box} from '@material-ui/core';
import CompanyTable from './CompanyTable'
import Header from "../Basic/Header";
import './graphics.css';

import GraphicsLayout from "../Graphics/GraphicsLayout";

const useStyles = makeStyles((theme) => ({
    root: {
      backgroundColor: theme.palette.primary.main
    }
  }));


<link href="https://fonts.googleapis.com/icon?family=Material+Icons"
      rel="stylesheet">

      </link>


function Company (){
        const theme = useStyles();
        return (


            <div className={theme.root}>
                <Grid container direction = "column">
                    <Grid item><Header/></Grid> 
                    <Grid item container>
                        <Grid item xs = {0} sm = {2}/>
                        <Grid item xs = {0} sm = {2}/>
                    </Grid>
                </Grid>
                <h3>Company</h3>
                <Image
                    centered
                    size='large'
                    src={telefonica}
                />
                <Rating/>
                <Rating/>
                <Rating/>
                <Rating/>
                <Rating/>



                <div class = 'Box' className={theme.root}>
                  <Grid container justify = "center">
                      <CompanyTable/>
                  </Grid> 



                  <Grid  class = 'Box' container>
                    <Grid item xs={6}> 
                      <GraphicsLayout/> 
                    </Grid>
                    <Grid item xs={6}>
                      <GraphicsLayout/>
                    </Grid>
                  </Grid>


                  <Grid container direction = "column">
                      <Grid item><GraphicsLayout/></Grid> 
                  </Grid> 

              </div>  
            </div>


        )



}

export default Company;
